import axios from "axios";
import { BaseURL } from "../constants/BaseURL";

export const findLotteries = ():Promise<void> => {
  return axios
    .get(`${BaseURL}/loterias`)
    .then((res) => res.data)
    .catch((err) => console.log(err.response));
};


export const findContest = ():Promise<void> => {
  return axios
    .get(`${BaseURL}/loterias`)
    .then((res) => res.data)
    .catch((err) => console.log(err.response));
};
